import React from 'react';
import ReactDOM from 'react-dom';
import { Router, Route,} from 'react-router';
import FaleConosco from './Pages/FaleConosco';


ReactDOM.render((

  <Router>

<Route path="/" component={FaleConosco} />

  </Router>
),
  document.getElementById('faleConosco')

);
